import React from "react";
import { Link } from 'react-router-dom';
const links_info = [
  {
    title: '企業レポート',
    url: '/report/',
  },
  {
    title: '読み方',
    url: '/how_read/',
  },
  {
    title: '質問箱',
    url: '/question_box/',
  },
  {
    title: '日本最高基盤とは',
    url: '/our_company/',
  },
  {
    title: '東大金融会とは',
    url: '/ut_finance/',
  },
  {
    title: 'お問い合わせ',
    url: '/question/',
  },
]

const App_bar = () => {

  return (
    <div>
      {links_info.map((link) => (
        <Link to={link.url}>{link.title}</Link>
      ))}
    </div>
  )
}

export default App_bar
